import React, { Component } from 'react';
import axios from 'axios';
import NavbarHeader from './navbarhead';
import Timeslots from './Timeslots';
import './App.css';
class App extends Component {

  constructor(props) {
    super(props);

    this.state = {
      response: null,
    };
  }


  componentDidMount() {
    fetch('http://localhost:4000/purchase')
   .then((response) => response.json())
   .then((responseJson) =>{
     this.setState({
       message: responseJson.data
     });
   })
 }


  render() {
    return (
        <div className="App">
          <NavbarHeader />
          <Timeslots />
          <div>
          {JSON.stringify(this.state.response)}
          </div>

        </div>
    )
  }
}

export default App;
